import React from 'react';
import styles from './Project.module.css';


function Project() {
    return (
        <div className={styles.projectBox}>
            <div className={styles.projectIContainer}>
                <div> </div>
                <button className={styles.projectBtn}>Look</button>
            </div>
            <span className={styles.projectTitle}>Social_Network</span>
            <span className={styles.projectDescription}>Социальная сеть для знакомства и общения</span>
        </div>
    );
}

export default Project;
